s.aO(0,"Circles",new A.b6m(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/collision_detection/circles_example.dart","    This example will create a circle every time you tap on the screen. It will\n    have the initial velocity towards the center of the screen and if it touches\n    another circle both of them will change color.\n  ")
s.aO(0,"Bouncing Ball",new A.b6n(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/collision_detection/bouncing_ball_example.dart","    This example shows how you can use the Collisions detection api to know when a ball\n    collides with the screen boundaries and then update it to bounce off these boundaries.\n  ")
